import React, { Component } from "react";
import { Link } from "react-router-dom";

const Logo = props => {
  const { branding } = props;
  return (
    <div className="Logo">
      <p className="text-left display-4">
        <Link to="/" className="text-decoration-none text-secondary ">
          {branding}
        </Link>
      </p>
    </div>
  );
};

Logo.defaultProps = {
  branding: "Bazinga"
};

export default Logo;
